import React from 'react';
function Header() {
  return (
    <header>
      <div className="container">
        <div className="inner-content">
          <div className="brand">
            <h1>Movie Card</h1>
          </div>
          <h3>My WhatchList</h3>
        </div>
      </div>
    </header>
  );
};


export default Header;
